import React from "react";
import styled from "styled-components";
import { NavLink } from "react-router-dom";

const LeftbarPositioner = styled.div`
  width: 7rem;
  height: 100vh;
  border: solid green;
`;

const LeftbarHeader = styled.div`
  text-align: center;
  padding-bottom: 0.5rem;
  border-bottom: solid;
`;

const LeftbarBody = styled.div``;

function Sidebar() {
  return (
    <LeftbarPositioner>
      <LeftbarHeader>MY SPACE</LeftbarHeader>
      <LeftbarBody>
        <NavLink to="/mystage/create ">명함만들기</NavLink>
        <NavLink to="/mystage/repository ">명함보관함</NavLink>
      </LeftbarBody>
    </LeftbarPositioner>
  );
}

export default Sidebar;
